@jigglekoon my fellow alcoholic. @dfsofficial Only God knows how I wish I could make you stay for some days more. But its time to say goodbye to you, my friend. My best wishes will always be with you!

Life is a journey that lets you befriend many people on your way. But only a few are capable of staying in your heart forever. Goodbye my friend!

It doesn’t matter where life takes us, you and I both know that we will meet again and make some wonderful memories. Till then, goodbye my dear friend!

I can't believe DFS is closing! I used to commute weekly between SIN-KUL and would be early at the airport on Fri to shop at DFS and enjoy a glass of their promo drinks to kill time before boarding. Will definitely miss the wonderful staff and wonderful Singaporean hospitality displayed by DFS! 
